Comment.val:
/*Onderhouden en weergeven van aanmaningsbrieven.*/
In dit programma kan per relatie worden bijgehouden wanneer een aanmaningsbrief (3x) is verstuurd. Achter elke brief staat een teller die bijhoudt hoe vaak er eerder een aanmaning is verstuurd naar de relatie. . Ook is het mogelijk om aan te geven wanneer een relatie naar Intensief Beheer gaat.
Indien een relatie geen achterstand meer heeft, kan middels de <Verwijderen> button de aanmaningen verwijderd worden.
